def r9(r9, big_arr, n9):
    arr = []
    a = [1, 2, 3, 4, 5]
    b = [1, 2, 3]
    c = [1, 2, 3]
    for i in range(r9):
        key = random.choice([0, 1])
        ind = random.choice(a) - 1
        arr.append(ind)
        ind1 = random.choice(b) - 1
        b.remove(ind1+1)
