        w1 = big_arr[ind1][key][random.randint(0, len(big_arr[ind1][key])-1)]
        if len(big_arr[ind1][key]) > 1:
            big_arr[ind1][key].remove(w1)
        w2 = big_arr[ind1][key][random.randint(0, len(big_arr[ind1][key])-1)]
